$('#btnLogin').on('click', function(){
  var email = $('#usuario').val();
  var clave = $('#clave').val();
  firebase.auth().signInWithEmailAndPassword(email, clave).then(function(){
      $('#loginmodal').foundation('close');
    }).catch(function(error) {
      var errorCode = error.code;
      var errorMessage = error.message;
      alert('Ocurrió un error al iniciar sesión', errorMessage);
  });
});

function crearcuenta(email, clave, proyecto){
  firebase.auth().createUserWithEmailAndPassword(email, clave).then(function(u){
    db.child('/admin/'+u.uid).set({
      email: email,
      proyecto: proyecto,
      uid: u.uid
    },function(err){
      if(err){console.log(err);}else{
        db.child(proyecto+'/configuracion/colores').set({
          principalbg: "#2682DE",
          principalhv: "#134270",
          principalt2: "#54495C",
          principaltx: "#FFFFFF"
        },function(err){
          if(err){}else{
            db.child(proyecto+'/configuracion').set({
              sufijo: "pts"
            },function(err){
              if(err){}else{
                console.log('se creo el proyecto por defecto');
              }
            });
            // console.log('se creo el proyecto por defecto');
          }
        });
      }
    });
    $('#loginmodal').foundation('close');
  }).catch(function(error) {
    var errorCode = error.code;
    var errorMessage = error.message;
    console.log('Ocurrió un error al crear el usuario: ' , errorMessage);
  });
}

